import React, {Component} from "react";
import './Task.css'

class Task extends Component{
    render(){
        const {task} = this.props;
        return(
            <div>
              <p className="red">{task.id} - {task.titulo} - {String(task.done)}</p>
              <input type="checkbox"/>
              <button>
                  Button
              </button>
            </div> 
        )
    }
    
}

export default Task;
